import React from 'react';
import './Home.css';

function Home({ walletAddress }) {
  return (
    <div>
      <h2>Home</h2>
      <p>Welcome, {walletAddress}!</p>
      <p>You now have access to the Smart Wallet.</p>
    </div>
  );
}

export default Home;
